Meet 2 year old Brian who is looking for either a FOSTER or ADOPTIVE home.
Brian is a 60 pound ball of energy. He loves to run around and play. He is friendly and he is good with other dogs. Brian did test positive for heartworm but he has already been treated. Brian's goal in life is to have as much fun as possible. He would do best in a home with a large fenced in yard but he would also benefit from regular walks. He has lots of energy and needs a family that is active. 

